import React from 'react'
import Service from '../Service/Service'
import Header from '../Header'
const Services = ({services}) => {
  return (
    <div>
      
  <div className='group'>
   {
       services.map((service)=>{
           return <Service key={service.id} service={service}/>
       })
   }
   </div>
    </div>
  )
}

export default Services
